import '../css/App.css';
import '../images/open-ai.png'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="container-header">
          <div className="logo-open-ai">
            <img src="open-ai.png" alt="Open AI" />
            </div>
          <div className="menu-header">

          </div>
        </div>
      </header>

      <div className="main"></div>
    </div>
  );
}

export default App;
